import './app.css'

export default function App(props) {
  let newtext1 = props.prop1;
  let newtext2 = "     bignotsmall: " + props.bignotsmall;

  return (
    <div className={props.bignotsmall ? "bigmaindiv" : "smallmaindiv"}>

      {newtext1} <br /> {newtext2}

      <div className="positionButton">
        <button onClick={() => props.clickHandler()}>Alternate Size</button>
      </div>

    </div>
  );
}
